import React, { Component } from "react";

class SingleBuyOrder extends Component {
	render() {
		return (
			<React.Fragment>
				{this.props.buyOrdersArray.map((order) => {
					<p>{order.id}</p>;
				})}
			</React.Fragment>
		);
	}
}

export default SingleBuyOrder;
